INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 5118061, 40, 2, 8, 1, 20063115, 0, 2834, "フリーマーケット会場", "青空の下で謁見", 91002, 7, "ペコリーヌとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 5118062, 40, 2, 8, 1, 20063115, 0, 2835, "フリーマーケット会場", "未来の騎空団\nマスコット？", 91002, 7, "マホとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 5118063, 40, 2, 8, 1, 20063115, 0, 2837, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 91002, 7, "アキノとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 5118064, 40, 2, 8, 1, 20063115, 0, 4108402, "フリーマーケット会場", "黄金色の悩みごと", 91002, 18, "ジュンとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 5118065, 40, 2, 8, 1, 20063115, 0, 4107402, "フリーマーケット会場", "白熱！　格闘大会！", 91002, 18, "カオリとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 5118066, 40, 2, 8, 1, 20063115, 1, 9000227, "オーエド町", "祭り太鼓はオーエドの華", 91002, 16, "ニノンとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 5118067, 40, 3, 8, 1, 20063115, 0, 2101181, "フリーマーケット会場", "人気者は遅れて\nやってくる", 91002, 19, "スズナとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 5118068, 40, 3, 8, 1, 20063115, 0, 4109402, "ランドソル市街地", "巫女・ミーツ・魔法少女", 91002, 18, "ナナカとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 5118069, 40, 3, 8, 1, 20063115, 0, 4305402, "フリーマーケット会場", "ネズ耳は二度なくなる", 91002, 18, "キャル＆コッコロとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 5118070, 40, 3, 8, 1, 20063115, 0, 4101402, "ランドソル市街地", "この出会いにカンパイ！", 91002, 18, "ユカリとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 5118071, 40, 3, 8, 1, 20063115, 0, 4106402, "ランドソル市街地", "陰陽アンサンブル", 91002, 18, "アオイとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 5118072, 40, 3, 8, 1, 20063115, 1, 2836, "フリーマーケット会場", "運試し十番勝負！", 91002, 7, "シノブとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (10118, 0, 5118600, 0, 1, 0, 0, 20063115, 0, 0, 0, "彼女たちの新たな日常", 0, 0, "オープニング");
